import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const App = () => {
  console.log('Hello from component')
  const a = 10
  const b = 20
  return(
  <div>
    <p>Hello world</p>
    <p>
      {a} plus {b} is {a + b}
    </p>
  </div>
  )
  }

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

